// var canvasImg = document.getElementById("canvas_img")
import tool, { toolBoxInit, getToolConfig, getToolEvent } from './tool/index.js';
import Utils from './utils/utils.js'
const mineMap = {
    "image/bmp" : "bmp",
    "image/gif" : "gif",
    "image/heic" : "heic",
    "image/jpeg" : "jpg",
    "image/png" : "png",
    "image/svg+xml" : "svg",
    "image/webp" : "webp",
    "image/x-icon" : "ico"
}
const colors = [
    '#f52443', '#c66f35', '#eddd9e', '#1e3124',
    '#3c374a', '#777bce', '#2f4988', '#02b340',
    '#a0d878','#2d5131', '#79d2d2', '#cbe2e4',
    '#c9d8cd', '#dffff5','#fef8de', '#b3ffbc',
    '#ffb3b3','#ffb3b3','#e3efd1','#edf9df',
    '#ebdad3','#ffd7ea','#ffb3cc','#fef263',
    '#ebd2b8','#296939','#02b340','#8ace57',
    '#c2185b','#ff9800','#ff6f00','#ff3d00'
]
function randColor(colors) {
    return colors[Date.now() % colors.length];
}
const getPixelRatio = function (context) {
    const backingStore = context.backingStorePixelRatio ||
        context.webkitBackingStorePixelRatio ||
        context.mozBackingStorePixelRatio ||
        context.msBackingStorePixelRatio ||
        context.oBackingStorePixelRatio ||
        context.backingStorePixelRatio || 1;
    return (window.devicePixelRatio || 1) / backingStore;
};
class Palette {
    // 当前工具
    currentTool;
    // 历史记录
    history = [];
    constructor(dataUrl, scale) {
        // 初始化变量
        this.showImage(dataUrl);
        this.startX = this.startY = 0;
        this.isDown = false;
        // this.radio = scale
    }
    // 画图
    showImage(dataUrl) {
        console.log(dataUrl)
        const image = new Image();
        image.src = dataUrl;
        image.onload =  () => {
            // 初始化工具
            toolBoxInit.bind(this)();
            // 一些变量处理
            this.$containerOuter = document.getElementById('container_outer');
            this.$mainContainer = document.getElementById('container');
            this.$mainCanvas = document.getElementById('mainCanvas');
            this.$frontCanvas = document.getElementById('frontCanvas');
            this.$drawCanvas = document.getElementById('drawCanvas');
            this.$settingBox = document.getElementById('settingBox');
            this.$toolbar = document.getElementById('toolbar');
            this.$cursor = document.getElementById('cursor');
            this.$tips = document.getElementById('tips');
            this.$containerMove = document.getElementById('container_move');
            // 画板上下文对象
            this.drawContext = this.$drawCanvas.getContext("2d");
            this.frontContext = this.$frontCanvas.getContext("2d");
            this.mainContext = this.$mainCanvas.getContext("2d");
            // 缩放比例
            this.radio = getPixelRatio(this.mainContext);
            // 容器
            this.imageWidth = image.width;
            this.imageHeight = image.height;
            this.containerWidth = image.width / this.radio;
            this.containerHeight = image.height / this.radio;
            if (window.ipcRendererUtils) {
                // 重新设置窗口大小
                setTimeout(() => {
                    const $toolbarBox = document.getElementById('toolbarBox');
                    console.log($toolbarBox.offsetWidth, 'width')
                    const width = Math.max(this.containerWidth, $toolbarBox.offsetWidth)
                    const height = this.containerHeight + 80;
                    window.ipcRendererUtils.setSize(width * this.radio + 100, height * this.radio + 100);
                    const $body = document.getElementsByTagName('body').item(0);
                    $body.style.width = `${width}px`;
                    $body.style.height = `${height}px`;
                    // 处理工具条位置
                    if (this.containerWidth > $toolbarBox.offsetWidth * this.radio) {
                        $toolbarBox.style.right = 0;
                    }
                }, 100)
            }
            console.log('scale', this.radio)
            // 对 canvas 处理
            this.$mainCanvas.width = image.width * this.radio;
            this.$mainCanvas.height = image.height * this.radio;
            this.$mainCanvas.style.width = `${image.width}px`;
            this.$mainCanvas.style.height = `${image.height}px`;
            // 其它辅助 canvas
            this.$frontCanvas.width = this.containerWidth * this.radio;
            this.$frontCanvas.height = this.containerHeight * this.radio;
            this.$frontCanvas.style.width = `${this.containerWidth}px`;
            this.$frontCanvas.style.height = `${this.containerHeight}px`;

            this.$drawCanvas.width = this.containerWidth * this.radio;
            this.$drawCanvas.height = this.containerHeight * this.radio;
            this.$drawCanvas.style.width = `${this.containerWidth}px`;
            this.$drawCanvas.style.height = `${this.containerHeight}px`;

            this.$containerMove.style.width = `${this.containerWidth}px`;
            this.$containerMove.style.height = `${this.containerHeight}px`;
            // 处理画板问题
            this.drawContext.scale(this.radio, this.radio);
            this.frontContext.scale(this.radio, this.radio);
            // 裁剪多余的画板
            // this.$containerOuter.style.width = `${this.containerWidth}px`;
            // this.$containerOuter.style.height = `${ this.containerHeight}px`;
            this.$mainContainer.style.width = `${this.containerWidth}px`;
            this.$mainContainer.style.height = `${ this.containerHeight}px`;
            this.$containerOuter.style.width = `${this.containerWidth + 10}px`;
            this.$containerOuter.style.height = `${this.containerHeight + 10}px`;
            this.$mainContainer.style.overflow = 'hidden';
            // 绘制图片
            this.mainContext.drawImage(image, 0, 0, image.width, image.height);
            // 绑定事件
            this.$frontCanvas.onmouseup = (e) => this.mouseUp(e);
            this.$frontCanvas.onmousemove = (e) => this.mouseMove(e);
            this.$frontCanvas.onmousedown = (e) => this.mouseDown(e);
            // 工具绑定事件
            document.querySelectorAll("#toolbar>div")
                .forEach($div =>
                    $div.onclick = (e) => this.setCurrentTool(e.target.getAttribute('name'))
                );
            // 工具初始化
            this.setCurrentTool('move');
            // 全局快捷键事件注册
            const data = window.UToolsUtils.read('globalKey');
            window.Mousetrap.bind(data['tab']?.split("|") || 'tab', () => this.switchToolBox());
            window.Mousetrap.bind(data['save']?.split("|") || 'ctrl+s', () => this.saveImageToFile());
            window.Mousetrap.bind('ctrl+shift+s', () => {
                this.saveImageToFile().then(res => {
                    window.ipcRendererUtils.winClose();
                });
            });
            window.Mousetrap.bind(data['copy']?.split("|") || 'ctrl+c', async () => utools.copyImage(await this.canvasToBase64()));
            window.Mousetrap.bind(data['randomColor']?.split("|") || 'ctrl+r', () => {
                if (getToolConfig(this.currentTool).settingBox === 'color&size') {
                    const color = randColor(colors);
                    this.setCursorColor(color);
                    document.getElementById('strokeStyle').value = color;
                }else if (getToolConfig(this.currentTool) === 'textBox') {
                    const color = randColor(colors);
                    this.setCursorColor(color);
                    document.getElementById('fontColor').value = color;
                }
            });
            window.Mousetrap.bind(data['clear']?.split("|") || 'ctrl+p', () => {
                this.clearFrontContext();
                this.drawContext.clearRect(0,0,this.$drawCanvas.width,this.$drawCanvas.height);
            });
            window.Mousetrap.bind(data['clearAll']?.split("|") || 'ctrl+shift+p', () => {
                this.clearFrontContext();
                this.drawContext.clearRect(0,0,this.$drawCanvas.width,this.$drawCanvas.height);
                document.querySelectorAll('.text_input').forEach(item => {
                    item.remove();
                })
                document.getElementById('serial_number_box').innerHTML = '';
            });
            this.$mainContainer.onmouseleave = (e) => {
                // 清理浮标
                this.$cursor.style.display = 'none';
                const mouseUpEvent = getToolEvent(this.currentTool, 'mouseUp');
                if (mouseUpEvent && this.isDown) {
                    this.mouseUp(e)
                }
                // this.setCurrentTool('move');
                // this.clearFrontContext();
            }
            if (utools.isMacOs()) {
                ipcRendererUtils.setIgnoreMouseEvents(true);
            }
            this.$mainContainer.onmouseenter = (e) => {
                if(getToolConfig(this.currentTool).cursor) {
                    this.$cursor.style.display = 'block';
                }
            }
        }
    }
    mouseDown(e) {
        const toolConfig = getToolConfig(this.currentTool);

        if (toolConfig.canvas) {
            this.setCanvasStyle(this.frontContext);
        }
        if (toolConfig.history) {
            this.pushHistory('draw', this.drawContext.getImageData(0,0,
                this.containerWidth * this.radio, this.containerHeight * this.radio));
        }
        this.isDown = true
        this.startPosition = {
            startX: e.offsetX,
            startY: e.offsetY
        }
        console.log(e);
        const toolMethod = tool(this.currentTool, 'mouseDown');
        if (toolMethod) {
            toolMethod.bind(this)(e);
        }
    }
    mouseMove(e) {
        this.offsetX = e.offsetX;
        this.offsetY = e.offsetY;
        const size = parseInt(this.$cursor.style.width);
        this.$cursor.style.top = (e.offsetY - size / 2) + 'px';
        this.$cursor.style.left = (e.offsetX - size / 2) + 'px';
        if (!this.isDown) {
            return;
        }
        const toolMethod = tool(this.currentTool, 'mouseMove');
        if (toolMethod) {
            toolMethod.bind(this)(e);
        }
    }
    mouseUp(e) {
        if (!this.isDown) {
            return;
        }
        // console.log(e)
        const toolConfig = getToolConfig(this.currentTool);
        if (toolConfig.canvas) {
            this.setCanvasStyle(this.drawContext);
        }
        this.isDown= false;
        const toolMethod = tool(this.currentTool, 'mouseUp');
        if (toolMethod) {
            toolMethod.bind(this)(e);
        }
    }
    async canvasToBase64() {
        this.setCurrentTool('move');
        this.$cursor.style.display = 'none';
        this.$mainContainer.style.borderRadius = '0';
        this.$mainContainer.style.boxShadow = 'nonce';
        // const { borderStatus = false, borderStyle = '2px solid #000' }
        //   = UToolsUtils.read('borderStyle/setting') || {};
        // if (borderStatus) {
        //     this.$mainCanvas.style.border = borderStyle;
        // }
        const canvas2 = document.createElement("canvas");
        canvas2.width = this.imageWidth * this.radio;
        canvas2.height = this.imageHeight * this.radio;
        canvas2.style.width = `${this.containerWidth}px`;
        canvas2.style.height = `${this.containerHeight}px`;
        return await html2canvas(this.$mainContainer, {
            backgroundColor: null,
            canvas: canvas2,
            removeContainer: false,
        }).then(async (canvas) => {
            this.$mainContainer.style.borderRadius = '6px';
            this.$mainCanvas.style.border = 'none';
            const imageData = canvas.getContext('2d').getImageData(0,0,this.containerWidth * this.radio,this.containerHeight * this.radio);
            const base64 = 'data:image/png;base64,' + window.imageDataToBase64(imageData)
            return base64
        })
    }
    async saveImageToFile() {
        const imageBase64 = await this.canvasToBase64();
        let [src, type, base64] = imageBase64.match(/^data:(image\/.+);base64,(.*)/)
        let suffix = mineMap[type]
        const preSavePath = UToolsUtils.read('preSavePath') || { value: '' };
        let defaultPath = preSavePath.value ? preSavePath.value : utools.getPath('downloads');
        const data = UToolsUtils.read('SaveFileName/setting');
        if (data && data.filenameFormat) {
            defaultPath = window.path.join(defaultPath, Utils.getSavePath(data.filenameFormat, ''));
        } else {
            defaultPath = window.path.join(defaultPath, Date.now().toString())
        }
        defaultPath += '.' + suffix;
        window.saveFileByBase64(defaultPath, base64);
    }
    clearFrontContext() {
        this.frontContext.clearRect(0,0,this.$frontCanvas.width,this.$frontCanvas.height);
    }
    setCurrentTool(toolName) {
        if (this.currentTool === toolName) {
            return;
        }
        this.clearFrontContext();

        const priorToolName = this.currentTool;
        this.currentTool = toolName;

        // 工具箱的显示
        const { settingBox = '' } = getToolConfig(toolName)
        if (settingBox) {
            Array.from(this.$settingBox.children).map($div => {
                const name = $div.getAttribute('name')
                $div.style.display = name === settingBox ? 'inline-flex' : 'none';
            });
            this.$settingBox.style.display = 'inline-flex';
        } else {
            this.$settingBox.style.display = 'none';
        }
        // 工具选中样式
        const $divs = document.querySelectorAll("#toolbar>div");
        $divs.forEach($div => {
            if ($div.classList.contains('active')) {
                const toolName = $div.getAttribute('name');
                // 执行工具摧毁方法
                const toolDestroyMethod = tool(toolName, 'destroy');
                if (toolDestroyMethod) {
                    toolDestroyMethod.bind(this)();
                }
            }
            $div.classList[
                $div.getAttribute('name') === toolName ? 'add' : 'remove'
                ]('active');
        })
        // 执行工具初始化方法
        const toolInitMethod = tool(toolName, 'init');
        if (toolInitMethod) {
            toolInitMethod.bind(this)(priorToolName, toolName);
        }
    }
    switchToolBox() {
        const display = this.$toolbar.style.display;
        if (display === 'inline-flex') {
            this.$toolbar.style.display = 'none';
            this.setCurrentTool('move');
        }else  {
            this.$toolbar.style.display = 'inline-flex';
            this.setCurrentTool('move');
        }
    }
    setCanvasStyle(context) {
        const lineWidth = document.getElementById('lineWidth').value
        const strokeStyle = document.getElementById('strokeStyle').value
        console.log(lineWidth, strokeStyle)
        context.lineWidth = parseInt(lineWidth) + 0.5 * this.radio;
        context.strokeStyle = strokeStyle;
    }
    setCursorSize(size, autoHide = true) {
        this.$cursor.style.display = 'block';
        this.$cursor.style.width = size + 'px';
        this.$cursor.style.height = size + 'px';
        this.$cursor.style.top = (this.offsetY - size / 2) + 'px';
        this.$cursor.style.left = (this.offsetX - size / 2) + 'px';
        if (autoHide) {
            setTimeout(() => {
                this.$cursor.style.display = 'none';
            }, 1000);
        }
    }
    setCursorColor(color) {
        console.log(this.offsetY)
        const preStyle = this.$cursor.style;
        console.log(document.getElementById('cursor').style.width)
        const size = Math.max(parseInt(this.$cursor.style.width), 10);
        this.$cursor.style.width = size + 'px';
        this.$cursor.style.height = size + 'px';
        this.$cursor.style.top = (this.offsetY - size / 2) + 'px';
        this.$cursor.style.left = (this.offsetX - size / 2) + 'px';
        this.$cursor.style.border = `2px dashed ${color}`;
        this.$cursor.style.display = 'block';
        setTimeout(() => {
            this.$cursor.style.width = preStyle.width;
            this.$cursor.style.height = preStyle.height;
            this.$cursor.style.border = `2px dashed ${color}`
            this.$cursor.style.display = 'none';
        }, 1000);
    }
    showTips(message) {
        this.$tips.innerHTML = message;
        this.$tips.style.opacity = 1;
        setTimeout(() => {
            this.$tips.style.opacity = 0;
            this.$tips.innerHTML = '';
        }, 1500)
    }
    pushHistory(type, data) {
        this.history.push({
            type,
            data
        })
    }
}


window.setImage = (dataUrl, scale) => {
    window.palette = new Palette(dataUrl, scale);
};
if (!window.ipcRendererUtils) {
    window.setImage('data:image/png;base64,')
}
